import React, {useState} from "react";


const AddUser = () => {
    const [user, setUser] = useState({
        name: "",
        username: "",
        email: "",
        phone: "",
        website: ""
    });

    const onInpChange = (e) => {
        console.log(e.target.value);
    };

    return(
        <>
        <div className="container">
        <h1 className="mt-5 mb-5">Add User</h1>
        <form>
  <div class="form-group">
    <label for="exampleInputEmail1">Name</label>
    <input type="txt" name="name" value={name} class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter name"/>
  </div>
  <div class="form-group">
    <label for="exampleInputEmail1">User Name</label>
    <input type="txt" name="username" value={username} class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter user name"/>
  </div>
  <div class="form-group">
    <label for="exampleInputEmail1">Email</label>
    <input type="email" name="email" value={email} class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email"/>
  </div>
  <div class="form-group">
    <label for="exampleInputEmail1">Phone Number</label>
    <input type="txt" name="phone" value={phone} class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter phone number"/>
  </div>

  <div class="form-group">
    <label for="exampleInputEmail1">Website</label>
    <input type="txt" name="website" value={website} class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter website"/>
  </div>

  <button type="submit" class="btn btn-primary mt-3">Submit</button>
</form>
        </div>
        </>
    );

};


export default AddUser;
